import React from "react";
import "./App.css";
export default function Homepage() {
  return (
    <div className="container header mt-3 text-left">
      <p className="para">
        Welcome to our personalized timetable generator!
        <br />
        Our website is designed to help you create the perfect study schedule
        tailored to your unique needs for exam season.
        <br />
        Simply enter a few basic details about your subjects, including the
        number of days per week, subjects and their credit hours, study hours
        per day, break intervals (in hours), and break duration (in minutes).
        Our system will then generate a customized timetable that covers your
        entire syllabus, making it an invaluable tool for students in both
        schools and colleges. Start optimizing your study time today with our
        easy-to-use timetable generator!
      </p>
    </div>
  );
}
